        try {
            Thread.sleep(errorSleepTime);
            log.error("æ— æ³•æ‰“å¼€é“¾æŽ¥" + url + " sleep " + errorSleepTime + e);
        } catch (Exception e1) {
            log.error("Error sleeping " + errorSleepTime + e1);
        }
    }

